const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://jsonplaceholder.typicode.com/todos/1').then((data)=>{
        data.json().then(result => {
            console.log("result",result)
            setUser(result.data)
            setUser(result.data) 
        })
    })

  },[])
  return (
    <>
   <div>
    {
        user.map((item,index )=>{
           <tr>
            <td>{}</td>
            <td></td>
            <td></td>
            <td></td>
           </tr>

        })
    }
   </div>

    </>
  );
};

export default Api;
